import React, { useState, useEffect } from "react";
import axios from "../api/axios";

const MovieList = ({ title, id, fetchURL }) => {
  /* useState */
  const [] = useState();

  /* useEffect */
  const fetchMovieList = async (url) => {};
  useEffect(() => {
    fetchMovieList(fetchURL);
  }, []);

  /* Main Content */
  return <section>MovieList</section>;
};

export default MovieList;
